const NavBar = () => {
    return ( 
        <div className="text-center">
        <Link to="/" className="btn btn-secondary btn-lg background:red">Login</Link>
        <Link to="/register" className="btn btn-secondary btn-lg">Register</Link>
        </div>
     );
}
 
export default NavBar;
